<script>
import { nearR160, nextR160 } from '@smirnovvdonsk/preffered-numbers';

export default {
	name: 'DimDraw',
	props: {
		obj: Object, // Ссылка на объект, свойство которого будет изменяться
		tofixed: {
			type: Number,
			default: 1,
		},
	},
	computed: {
		// Массив строк для отображения в SVG-картинке
		dim() { return this.obj.dim.map(value => this.toString(value)) },
	},
	methods: {
		toString(value) {
			let result = '';
			if (!isNaN(+value)) result = (+nextR160(+value).toFixed(this.tofixed)).toString().replace('.', ',');
			return result
		},
		saveSVG(event) {
			event.preventDefault();
			let blob = new Blob([event.currentTarget.querySelector('svg').outerHTML], { type: 'image/svg+xml' });
			let a = document.createElement("a");
			document.body.appendChild(a);
			a.style = "display: none";
			let url = window.URL.createObjectURL(blob);
			a.href = url;
			a.download = `${this.obj.scheme}_d${this.obj.Dmm.toFixed(0)}mm_${(this.obj.depth == 2) ? 'TwinSide_' : ''}Dim.svg`;
			a.click();
			window.URL.revokeObjectURL(url);
		},
	},
}
</script>

